css:
atom-panel .mocha-test-runner,
.tool-panel .mocha-test-runner {
  text-shadow: none;
}
.mocha-test-runner {
  display: -webkit-flex;
  -webkit-flex-direction: column;
  min-height: 32px;
}
.mocha-test-runner .panel {
  display: -webkit-flex;
  -webkit-flex-grow: 1;
  -webkit-flex-direction: column;
  background-color: #181818;
  margin: 0;
}
.mocha-test-runner .panel .close-icon {
  padding: 5px;
  cursor: initial;
}
.mocha-test-runner .panel .close-icon:before {
  font-family: 'Octicons Regular';
  -webkit-font-smoothing: antialiased;
  width: 12px;
  content: "\f081";
}
.mocha-test-runner .panel .close-icon:hover {
  color: #fff;
}
.mocha-test-runner .panel .heading {
  flex-shrink: 0;
  padding: 10px;
  color: black;
  cursor: row-resize;
}
.mocha-test-runner .panel .panel-body {
  padding: 0;
  overflow-y: scroll;
}
.mocha-test-runner .results {
  background-color: #181818;
  color: #F8F8F8;
  font-size: 12px;
}
.mocha-test-runner .results a {
  color: #F8F8F8;
}
